    dialogs: [
        {id: 1, name: 'Tania'},
        {id: 2, name: 'Rost'},
        {id: 3, name: 'Vlad'},
        {id: 4, name: 'Dima'},
        {id: 5, name: 'Anton'}
    ],
    messages: [
        {id: 1, message: 'Hello'},
        {id: 1, message: 'Haw are you?'},
        {id: 1, message: 'Yep'}
    ]
}

export default state;
